import React from "react";

function Footer() {
  return (
    <div
      className="container"
      style={{ padding: "2rem 0", borderTop: "1px solid gray" }}
    >
      <span
        style={{
          textAlign: "center",
          display: "block",
          color: "black",
          fontSize: "1.2rem",
        }}
      >
        Created By VenkataRavindra
      </span>
    </div>
  );
}

export default Footer;
